window.bookSummaryJSON = "<p>Caitlyn Aguirre is no magician - but that doesn't make her useless.</p> <p>After discovering her true talent and uncovering the long-lost secret behind Objects of Power, Cat returns to school - intent on showing everyone what she can do. But her mere existence is a threat to the balance of power, convincing some to befriend her, some to try to use her...and some to remove her.</p> <p>And when she and her closest friends become the target of a deadly plot, she must use all her wits to save them and escape before she becomes the first casualty in a deadly war.</p>"; 
